import React, { useEffect } from 'react'
import { useLocation } from 'react-router-dom'

function Certificate({result}) {
  const location = useLocation()
  const data = location.state
  return (
    <>
    <h1>name: {toUpperCase(data.name)}</h1>
    <h2>seat number: {data.seatno}</h2>
    <h2>branch: {data.exam.branch}</h2>
    <h2>sem: {data.exam.sem}</h2>
    <h2>year: {data.exam.year}</h2>
    <h2>Marks</h2>
    <ul>
      {Object.keys(data.marks).map((item, index) => {
        return <li>{item} : {Object.values(data.marks)[index]}</li>
        })}
    </ul>
    <h2>SGPI: {data.sgpi}</h2>
    <h3>remark: {data.remark}</h3>
    </>
  )
}

export default Certificate
